import React from 'react';
import '../../App.css';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import {Form,Col, Button} from 'react-bootstrap';
import {Container, Typography} from "@material-ui/core";
import logo from '../../assets/image/logo.png';
import DoctorNavigation from '../../components/DoctorNavigation';
 
const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    marginLeft:200,
    marginBottom:100
  },
  details: {
    display: 'flex',
    flexDirection: 'column',
  },
  content: {
    flex: '1 0 auto',
  },
  cover: {
    width: 400,
  },
  controls: {
    display: 'flex',
    alignItems: 'center',
    paddingLeft: theme.spacing(1),
    paddingBottom: theme.spacing(1),
  },
  playIcon: {
    height: 38,
    width: 38,
  },
}));

export default function Patient() {
  const classes = useStyles();
  const theme = useTheme();

  return (
    <Container>
      <DoctorNavigation />
      <div className="VCLabel"  >
        <img src={logo} style={{height:100,width:100, marginLeft:130}} />
 <Typography style={{fontFamily:"Carter One",color:"#fff",fontSize:50,marginLeft:70}} >
        Patient
      </Typography>
      </div>
    <Card className="registration">
    <CardMedia
        className={classes.cover}
        // image="https://images.pexels.com/photos/5412/water-blue-ocean.jpg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940"
        // title="Live from space album cover"
        style={{backgroundColor:"#41649c"}}
      />
      
      <div className={classes.details}>
        <CardContent className={classes.content}>
          <Typography style={{fontSize:30, marginBottom:20,fontFamily: "Carter One", color: "#41649c"}}>
            Registration Form
          </Typography>
        <Form>
        <Form.Row>
    <Form.Group as={Col} controlId="formGridPatientID">
      <Form.Label className="labelName">Patient-id</Form.Label>
      <Form.Control type="text" placeholder="Enter Patient-id" />
    </Form.Group>
</Form.Row>
  <Form.Row>
    <Form.Group as={Col} controlId="formGridTName">
      <Form.Label className="labelName">Test Name</Form.Label>
      <Form.Control type="text" placeholder="Enter Test Name" />
    </Form.Group>

    <Form.Group as={Col} controlId="formGridTtype">
      <Form.Label className="labelName">Test Type</Form.Label>
      <Form.Control type="text" placeholder="Enter Test Type" />
    </Form.Group>
  </Form.Row>
  <Form.Row>
  <Form.Group as={Col} controlId="formGridTsample">
      <Form.Label className="labelName">Test Sample No</Form.Label>
      <Form.Control type="text" placeholder="Enter Test Sample NO" />
    </Form.Group>
    </Form.Row>
    <Form.Row>
<Form.Group as={Col} controlId="formGridTastedat">
  <Form.Label className="labelName">Tested At</Form.Label>
  <Form.Control type="Password" placeholder="Enter testedat" />
</Form.Group>
<Form.Group controlId="formGridtestedby">
<Form.Label className="labelName">Tested By</Form.Label>
<Form.Control type="Email" placeholder=" Enter Testedby" />
</Form.Group>
</Form.Row>

  <Form.Row>
    <Form.Group as={Col} controlId="formGridDate">
      <Form.Label className="labelName">Date</Form.Label>
      <Form.Control type="text" placeholder="Enter Date" />
    </Form.Group>

    <Form.Group as={Col} controlId="formGridBgroup">
      <Form.Label className="labelName">Blood Group</Form.Label>
      <Form.Control type="Password" placeholder="Enter BloodGroup" />
    </Form.Group>
  </Form.Row>
  <Form.Row>
  <Form.Group as={Col} controlId="formGridResult">
      <Form.Label className="labelName">Test Result</Form.Label>
      <Form.Control type="Password" placeholder="Enter Test Result" />
    </Form.Group>
    </Form.Row>

  <Button variant="primary" type="submit">
    Register
  </Button>
</Form>
         
        </CardContent>
        
      </div>
    
    </Card>
    </Container>
  );
}
